import React from 'react'
import { Link } from 'react-router-dom'

const SidebarChat = () => {


    return (
        <div className="sidebar_chat border-bottom border-1 px-4 py-2">
            <div className="contact_name">
                <Link to="#"></Link>
            </div>
            <div className="last_message">
                hey
            </div>
        </div>
    )
}

export default SidebarChat;
